import { Importer, ImporterField } from 'react-csv-importer';
// include the widget CSS file whichever way your bundler supports it
import 'react-csv-importer/dist/index.css';

import { fixture } from '../test/fixture.js';
// const apiUrl = "https://run.mocky.io/v3/cbca762d-3f84-4ae4-bb26-79fa774a6c72";
const apiUrl = "";


const HomePage = () => {


    const data = fixture;//fileUpload;
    console.log(data);


    const handleSubmit = async () => {
        try {
            const result = await fetch(apiUrl, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            if (result.ok) {
                console.log(result);
            } else {
                throw new Error();
            }
        } catch (e) {
            console.log(e);
        }
    };
    function showMyAppToastNotification() { }
    function goToMyAppNextPage() { }
    function myAppMethod() { }
    function prepMyAppForIncomingData() { }



    return (
        <>
            <div className="row">
                <div>
                    <h4>Hello World</h4>

                </div>
            </div>
            {(
                <>



                    <Importer
                        chunkSize={10000}
                        assumeNoHeaders={false}
                        restartable={false}
                        onStart={() => {
                            prepMyAppForIncomingData();
                        }}
                        processChunk={async (rows) => {
                            for (const row of rows) {
                                await myAppMethod(row);
                            }
                        }}
                        onComplete={() => {
                            showMyAppToastNotification();
                        }}
                        onClose={() => {
                            goToMyAppNextPage();
                        }}
                    >
                        <ImporterField name="name" label="Name" />
                        <ImporterField name="email" label="Email" />
                        <ImporterField name="dob" label="Date of Birth" optional />
                        <ImporterField name="postalCode" label="Postal Code" optional />
                    </Importer>
                </>
            )}
        </>
    )
};

export default HomePage;
